%[text] # Physics-Informed Neural Networks for Complex-Valued Condensed Matter Systems
%[text] This example shows how to train a physics-informed neural network to simulate the behavior of electrons inside a simplified 2-D condensed matter system.
%[text] Physical observables, such as temperature, angular momentum, or position, are real numbers. However, in quantum mechanics, the underlying quantity describing the state of a physical system, known as the wave function, is complex-valued. You can derive the real-valued physical observables from the complex-valued wave function. To model the behavior of the wave function, and therefore the behavior of the physical observables, in a quantum mechanical system, solve a complex-valued partial differential equation known as the Schrödinger equation.
%[text] The quantum mechanical state of electrons in crystals can be described in terms of this complex partial differential equation:
%[text] $\\left\[ -\\frac{1}{2}\\nabla^2\_\\mathbf{r}+\\mathrm{i}\\mathbf{k}\\cdot\\nabla\_\\mathbf{r} - \\frac{1}{2}\\mathbf{k}^2-V(\\mathbf{r})\\right\]u\_\\mathbf{k}(\\mathbf{r}) = E\_\\mathbf{k}u\_\\mathbf{k}(\\mathbf{r})\\;,$
%[text] derived from the Schrödinger equation by using the Bloch theorem. Here, $u\_\\mathbf{k}(\\mathbf{r})$is the periodic part of the electron wave function, $E\_\\mathbf{k}$ is the energy, and $\\mathbf{r}$ and $\\mathbf{k}$ are the real and reciprocal space coordinates, respectively. For more information, see for example [Bloch's theorem](https://en.wikipedia.org/wiki/Bloch%27s_theorem). 
%[text] This example describes how to model a system of free electrons ($V(\\mathbf{r})=0$) in a 2-D square crystal.
%[text] Following the work by Hsu et al [\[1\]](internal:M_9aca), model the system using two simple feedforward networks for the wave functions and energy, respectively. Connect the networks with a loss function that incorporates the Schrödinger equation as well as the periodic boundary conditions. 
%[text] ## Create Training Data
%[text] In this network, the training data is composed of single reciprocal space points for the energy network, and pairs of one real space point and one reciprocal space point for the wave function network.
%[text] First, define the crystal structure by defining the lattice constant, as well as the real space and reciprocal lattice vectors. The real space lattice vectors define the periodicity of the crystal:
%[text] ![](text:image:7242)
%[text] The lattice constant a is the length of the lattice vectors, and the reciprocal lattice vectors `b1` and `b2`  are related to the real space lattice vectors `a1` and `a2` by the relation:
%[text] $\\mathbf{a}\_i\\cdot\\mathbf{b}\_j=2\\pi\\delta\_{ij}\\;.$
crystalStructure.a = 1;
crystalStructure.a1 = crystalStructure.a * [1 0];
crystalStructure.a2 = crystalStructure.a * [0 1];
crystalStructure.b1 = 2*pi/crystalStructure.a * [1 0]; 
crystalStructure.b2 = 2*pi/crystalStructure.a * [0 1];
%%
%[text] ### Create Reciprocal Space Points
%[text] Create `nPoints` reciprocal space points using the `reciprocalSpaceSampling` function, attached to this example as a supporting file. 
%[text] Take advantage of the crystal symmetry by only sampling from the irreducible Brillouin zone. Then, randomly shift some of the points by reciprocal lattice vectors into the surrounding Brillouin zones. This process is known as the *extended zone scheme*, and it increases the likelihood of the network generating higher-energy states.
%[text] The first 30% of the k-points vector `kPts` lie along the Brillouin zone path $\\Gamma\\rightarrow X\\rightarrow M\\rightarrow\\Gamma\\;.$ The `reciprocalSpaceSampling` function also returns the position of the path points along the path. Use the Brillouin zone path when plotting the band structure later.
%[text] ![](text:image:75c8)
crystalStructure.nPoints = 5000;
[kPts,bzBoundaryPosition] = reciprocalSpaceSampling(crystalStructure);
%%
%[text] Plot the reciprocal space points.
figure %[output:4a180589]
scatter(kPts(:,1),kPts(:,2),'.') %[output:4a180589]
axis equal %[output:4a180589]
%%
%[text] ### Create Real Space Points
%[text] Next, create `nPoints` real space points randomly sampled from the unit cell using the `realSpaceSampling` function, attached to this example as a supporting file.
rPts = realSpaceSampling(crystalStructure);
%[text] Plot the real space points.
figure %[output:55becd53]
scatter(rPts(:,1),rPts(:,2),'.') %[output:55becd53]
axis equal %[output:55becd53]
%[text] Concatenate the real and reciprocal space points into a single array.
XTrain = [rPts kPts];
%[text] ## Create Networks
%[text] Start by creating the feedforward networks for the energy and the wave functions. Following Hsu et al [\[1\]](internal:M_9aca), both networks have four [`fullyConnectedLayer`](https://www.mathworks.com/help/deeplearning/ref/nnet.cnn.layer.fullyconnectedlayer.html) objects separated by [`swishLayer`](https://www.mathworks.com/help/deeplearning/ref/nnet.cnn.layer.swishlayer.html) objects. The fully connected layers in the energy network have output size 384, and the fully connected layers in the wave function network have output size 128.
%[text] The energy network takes two inputs $\\mathbf{k}=(k\_x,k\_y)$ and returns a single output $E\_\\mathbf{k}$.
layersE = [
    featureInputLayer(2)        % Input: kx,ky
    fullyConnectedLayer(384)
    swishLayer
    fullyConnectedLayer(384)
    swishLayer
    fullyConnectedLayer(384)
    swishLayer
    fullyConnectedLayer(384)
    swishLayer
    fullyConnectedLayer(1)];    % Output: Ek 
netE = dlnetwork(layersE);
%[text] The wave function network takes four inputs, $\\mathbf{k}=(k\_x,k\_y)$ and $\\mathbf{r}=(x,y)$ and returns a single complex output $u\_\\mathbf{k}(\\mathbf{r})$. In this example, express $u\_\\mathbf{k}(\\mathbf{r})$ in terms of two real outputs, the real and imaginary parts of $u\_\\mathbf{k}(\\mathbf{r})$, respectively.
%[text] **Periodicity.** To ensure that the wave functions satisfy the periodic boundary conditions in both real and reciprocal space, first map the input to a periodic coordinate representation following [\[3\]](internal:M_54cd). In a square lattice, the real space grid has a lattice constant of $a$, and the reciprocal lattice has a lattice constant of $2\\pi/a$.
%[text] $\\mathbf{\\tilde{x}}=\\left\[ \\sin\\left(\\frac{2\\pi}{a}x\\right),\\cos\\left(\\frac{2\\pi}{a}x\\right),\\sin\\left(\\frac{2\\pi}{a}y\\right),\\cos\\left(\\frac{2\\pi}{a}y\\right),\\sin\\left(ak\_x\\right),\\cos\\left(ak\_x\\right),\\sin\\left(ak\_y\\right),\\cos\\left(ak\_y\\right) \\right\]\\;.$
%[text] Then, to ensure that the network does not have spectral bias, use a *random Fourier feature* to map the coordinates to a higher-dimensional space[\[3\]](internal:M_54cd).
%[text] $\\Phi(\\mathbf{\\tilde{x}}) = \\left\[ \\sin(\\mathbf{B\\tilde{x}}),\\cos(\\mathbf{B\\tilde{x}}) \\right\]\\;,$
%[text] where $\\mathbf{B}$ is a random 128-by-8 matrix. 128 is the output size of the subsequent fully connected layer, and 8 is the size of $\\mathbf{\\tilde{x}}$. Multiply the random variable by 2 to sample from a normal distribution with standard deviation 2.
B = 2*randn(128,8);
%[text] To perform this mapping, add two [`functionLayer`](https://www.mathworks.com/help/deeplearning/ref/nnet.cnn.layer.functionlayer.html) objects to the beginning of the network. Specify the functions as [`mapInputsToPeriodicCoordinates`](internal:M_3e06) and [`randomFourierFeature`](internal:M_96ae), respectively. These functions are defined at the bottom of this example. Both functions support acceleration, so set the `Acceleratable` name-value argument to `true`.
layersU = [
    featureInputLayer(4)        % Input: x,y,kx,ky
    functionLayer(@(xTrain) mapInputsToPeriodicCoordinates(xTrain,crystalStructure.a),Acceleratable=true)
    functionLayer(@(xTilde) randomFourierFeature(xTilde,B),Acceleratable=true)
    fullyConnectedLayer(128)
    swishLayer
    fullyConnectedLayer(128)
    swishLayer
    fullyConnectedLayer(128)
    swishLayer
    fullyConnectedLayer(128)
    swishLayer
    fullyConnectedLayer(2)];    % Output: Re(uk), Im(uk)
netU = dlnetwork(layersU) %[output:4ce7e189]
%%
%[text] ## Create Loss Function
%[text] Many physics-informed neural networks incorporate the equations they are solving into the loss function. For example, to solve a first-order differential equation of the form $x'=f(x,x')$, include the term $|x'-f(x,x')|$ in the loss function. This term is minimized by solutions to the differential equation.
%[text] In this example, include two loss terms:
%[text] - Schrödinger function loss — Ensure the outputs of the two networks combined satisfy the Schrödinger equation, $\\left|\\left\[ -\\frac{1}{2}\\nabla^2\_\\mathbf{r}+\\mathrm{i}\\mathbf{k}\\cdot\\nabla\_\\mathbf{r} - \\frac{1}{2}\\mathbf{k}^2-V(\\mathbf{r})\\right\]u\_\\mathbf{k}(\\mathbf{r}) - E\_\\mathbf{k}u\_\\mathbf{k}(\\mathbf{r})\\right|\\;.$
%[text] - Normalization loss — Ensure that the wave function network generates physically interesting non-zero wave functions by enforcing the normalization condition: $\\int\_\\text{unit cell}u\_\\mathbf{k}^\*(\\mathbf{r})u\_\\mathbf{k}(\\mathbf{r})\\,\\text{d}^2\\mathbf{r}\\,\\text{d}^2\\mathbf{k}=1\\;.$ \
%[text] The two loss terms are weighted relative to each other.
%[text] Specify the atomic pseudo potential, $V(\\mathbf{r})$, using the `atomicPseudoPotential` function, attached to this example as a supporting file. This function takes the two real space coordinates `x` and `y` as inputs and returns the potential `V(x,y)`. In this example, the potential is set to zero,$V(\\mathbf{r})=0$. To model a different atomic pseudo potential, adapt the `atomicPseudoPotential` function. Using a different potential can require different hyperparameters, such as the relative weights of the loss terms. Choosing hyperparameters requires empirical analysis. To explore different training option configurations by running experiments, you can use the [Experiment Manager](https://www.mathworks.com/help/deeplearning/ref/experimentmanager-app.html) app.
%[text] To accelerate the loss function for the custom training loop using the [`dlaccelerate`](https://www.mathworks.com/help/deeplearning/ref/dlaccelerate.html) function, include all loss terms in a single function.
function [loss,gradientsE,gradientsU,equationLoss,normalizationLoss] = lossTotal(netE,netU,X,crystalStructure)
x = X(1,:);
y = X(2,:);
kx = X(3,:);
ky = X(4,:);

E = forward(netE,[kx;ky]);
U = forward(netU,[x;y;kx;ky]);

a1 = crystalStructure.a1;
a2 = crystalStructure.a2;

%%% Schrödinger equation loss
V = atomicPseudoPotential(x,y);

U = stripdims(U);
x = stripdims(x);
y = stripdims(y);
UReal = U(1,:);
UImag = U(2,:);

URealSumB = sum(UReal, 2);
UImagSumB = sum(UImag, 2);
dUxReal = dlgradient(URealSumB,x,EnableHigherDerivatives=true);
dUxImag = dlgradient(UImagSumB,x,EnableHigherDerivatives=true);
dUyReal = dlgradient(URealSumB,y,EnableHigherDerivatives=true);
dUyImag = dlgradient(UImagSumB,y,EnableHigherDerivatives=true);

crystalMomentumReal = -(kx.*dUxImag + ky.*dUyImag) - 0.5*(kx.^2 + ky.^2).*UReal;
crystalMomentumImag = kx.*dUxReal + ky.*dUyReal - 0.5*(kx.^2 + ky.^2).*UImag;

atomicPotentialReal = -V.*UReal;
atomicPotentialImag = -V.*UImag;

eigenenergyReal = E.*UReal;
eigenenergyImag = E.*UImag;

kineticEnergyReal = -0.5 * (dllaplacian(URealSumB,x,1) + dllaplacian(URealSumB,y,1));
kineticEnergyImag = -0.5 * (dllaplacian(UImagSumB,x,1) + dllaplacian(UImagSumB,y,1));

lossReal = kineticEnergyReal + crystalMomentumReal + atomicPotentialReal + eigenenergyReal;
lossImag = kineticEnergyImag + crystalMomentumImag + atomicPotentialImag + eigenenergyImag;

equationLoss = lossReal.^2 + lossImag.^2;
equationLoss = sum(equationLoss,2)/numel(x);

%%% Normalization loss
integrationResolution = 100;
integrationPoints = linspace(0,1,integrationResolution)' * a1 + linspace(0,1,integrationResolution)' * a2;
[XIntegration,YIntegration] = meshgrid(integrationPoints(:,1),integrationPoints(:,2));
XIntegration = reshape(XIntegration,1,[]);
YIntegration = reshape(YIntegration,1,[]);

kxForIntegral = kx(1) * ones(size(XIntegration));   % use a different k-point each iteration
kyForIntegral = ky(1) * ones(size(YIntegration));

UToIntegrate = forward(netU,[XIntegration; YIntegration; kxForIntegral; kyForIntegral]');
U2ToIntegrate = UToIntegrate(:,1).^2 + UToIntegrate(:,2).^2;
U2ToIntegrate = reshape(U2ToIntegrate,integrationResolution,[]);

waveFunctionIntegral = trapezoidIntegral(integrationPoints(:,2),trapezoidIntegral(integrationPoints(:,1),U2ToIntegrate));   % custom integral function

normalizationLossWeight = 5e3;  % weigh normalization loss relative to Schrödinger equation loss
normalizationLoss = normalizationLossWeight*abs(1 - waveFunctionIntegral);

%%% Compute total loss
loss = equationLoss + normalizationLoss;
[gradientsE,gradientsU] = dlgradient(loss,netE.Learnables,netU.Learnables);
end
%[text] ## Train Network
%[text] To train two networks connected by a single loss function, use a custom training loop. For another example of two networks connected by a shared loss, see [Train Variational Autoencoder (VAE) to Generate Images](https://www.mathworks.com/help/deeplearning/ug/train-a-variational-autoencoder-vae-to-generate-images.html).
%[text] Specify the training options. Train for 500 epochs with a mini-batch size of 5000 and a learning rate of 0.001.
numEpochs = 500;
validationFrequency = 20;
miniBatchSize = 5000;
learnRate = 0.001;
%[text] Create a [`minibatchqueue`](https://uk.mathworks.com/help/deeplearning/ref/minibatchqueue.html) object that processes and manages mini-batches of data during training. For each mini-batch:
%[text] - Convert the training data to an array datastore
%[text] - Format the data with the dimension labels `"BC"` (batch, channel). By default, the `minibatchqueue` object converts the data to `dlarray` objects with underlying type `single`.
%[text] - Train on a GPU if one is available. By default, the `minibatchqueue` object converts each output to a `gpuArray` if a GPU is available. Using a GPU requires Parallel Computing Toolbox™ and a supported GPU device. For information on supported devices, see [GPU Computing Requirements](https://uk.mathworks.com/help/parallel-computing/gpu-computing-requirements.html) (Parallel Computing Toolbox).
%[text] - To ensure all mini-batches are the same size, discard any partial mini-batches. \
dsTrain = arrayDatastore(XTrain);
mbq = minibatchqueue(dsTrain, ...
    MiniBatchSize = miniBatchSize, ...
    MiniBatchFormat="BC", ...
    PartialMiniBatch="discard");
%[text] Initialize the parameters for the Adam solver.
trailingAvgE = [];
trailingAvgSqE = [];
trailingAvgU = [];
trailingAvgSqU = [];
%[text] Calculate the total number of iterations for the training progress monitor.
numObservationsTrain = size(XTrain,1);
numIterationsPerEpoch = ceil(numObservationsTrain / miniBatchSize);
numIterations = numEpochs * numIterationsPerEpoch;
%[text] Use the `dlaccelerate` function to speed up the evaluation of the model loss function `lossTotal` in the custom training loop.
crystalStructure = structfun(@dlarray,crystalStructure,UniformOutput=false);
lossFcn = dlaccelerate(@lossTotal);
%[text] Initialize the training progress monitor. Because the timer starts when you create the monitor object, make sure that you create the object close to the training loop.
monitor = trainingProgressMonitor( ... %[output:471da6c2]
    Metrics=["Loss","EQLoss","NormLoss"], ... %[output:471da6c2]
    Info="Epoch", ... %[output:471da6c2]
    XLabel="Iteration"); %[output:471da6c2]
%[text] Specify a logarithmic scale for the loss.
yscale(monitor,"Loss","log")
yscale(monitor,"EQLoss","log")
yscale(monitor,"NormLoss","log")
%[text] Train the network using a custom training loop. For each epoch, shuffle the data and loop over mini-batches of data. For each mini-batch:
%[text] - Evaluate the model loss and gradients using the [`dlfeval`](https://www.mathworks.com/help/deeplearning/ref/dlfeval.html) and `modelLoss` functions.
%[text] - Update the wave function and energy network parameters using the [`adamupdate`](https://www.mathworks.com/help/deeplearning/ref/adamupdate.html) function.
%[text] - Display the training progress. \
figure %[output:3481af2b]
epoch = 0;
iteration = 0;
% Loop over epochs.
while epoch < numEpochs && ~monitor.Stop %[output:group:877b6de3] %[output:471da6c2]
    epoch = epoch + 1;

    % Shuffle data.
    shuffle(mbq);

    % Loop over mini-batches.
    while hasdata(mbq) && ~monitor.Stop
        iteration = iteration + 1;

        % Read mini-batch of data.
        X = next(mbq);

        % Evaluate loss and gradients.
        [loss,gradientsE,gradientsU,eqLoss,normLoss] = dlfeval(lossFcn,netE,netU,X,crystalStructure);

        % Update learnable parameters.
        [netE,trailingAvgE,trailingAvgSqE] = adamupdate(netE, ...
            gradientsE,trailingAvgE,trailingAvgSqE,iteration,learnRate);

        [netU, trailingAvgU, trailingAvgSqU] = adamupdate(netU, ...
            gradientsU,trailingAvgU,trailingAvgSqU,iteration,learnRate);

        % Update the training progress monitor. 
        recordMetrics(monitor,iteration,Loss=loss,EQLoss=eqLoss,NormLoss=normLoss);
        updateInfo(monitor,Epoch=epoch + " of " + numEpochs);
        monitor.Progress = 100*iteration/numIterations;
    end
    if mod(epoch, validationFrequency) == 0
        E = forward(netE,kPts);
        plotBandStructure(kPts,E,bzBoundaryPosition) %[output:3481af2b]
        drawnow
    end
end %[output:group:877b6de3]
%%
%[text] ## Test Network
%[text] Calculate the energies and plot the band structure using the `plotBandStructure` function, attached to this example as a supporting file.
E = forward(netE,kPts);
plotBandStructure(kPts,E,bzBoundaryPosition) %[output:7a538107]
%%
%[text] Plot the lowest energy wave function at the center of the first Brillouin zone in a single unit cell using the `plotWaveFunction` function, attached to this example as a supporting file. For the case of free electrons, the true solution is for the periodic part of the electron wave function, $u\_\\mathbf{k}(\\mathbf{r})$, to be constant.
k = [0 0];
plotWaveFunction(k,netU,crystalStructure) %[output:8e1c1f6a]
%%
%[text] ## Supporting Functions
%[text] The `mapInputsToPeriodicCoordinates` function maps the real space and reciprocal space inputs to a periodic coordinate representation following [\[3\]](internal:M_54cd).
function xTilde = mapInputsToPeriodicCoordinates(xTrain,a) %[text:anchor:M_3e06]

x = xTrain(1,:);
y = xTrain(2,:);
kx = xTrain(3,:);
ky = xTrain(4,:);

Lk = 2*pi/a;
xTilde = dlarray(zeros(8,size(x,2)));
xTilde(1,:) = sin(2*pi/a*x);
xTilde(2,:) = cos(2*pi/a*x);
xTilde(3,:) = sin(2*pi/a*y);
xTilde(4,:) = cos(2*pi/a*y);
xTilde(5,:) = sin(2*pi/Lk*kx);
xTilde(6,:) = cos(2*pi/Lk*kx);
xTilde(7,:) = sin(2*pi/Lk*ky);
xTilde(8,:) = cos(2*pi/Lk*ky);
end
%[text] The `randomFourierFeature` function maps the periodic coordinates to a higher-dimensional space following [\[3\]](internal:M_54cd).
function phi = randomFourierFeature(xTilde,B) %[text:anchor:M_96ae]
phi = [sin(B*xTilde);cos(B*xTilde)];
end
%[text] The `trapezoidIntegral` function computes the trapezoidal numerical integration of the `dlarray` `f` with regards to variable `x`. To compute the trapezoidal numerical integration of a numerical array, use the [`trapz`](https://www.mathworks.com/help/matlab/ref/trapz.html) function instead. To calculate a two-dimensional integral, nest function calls to `trapezoidIntegral`, similar to `trapz`. For more information, see the [Multiple Numerical Integrations](https://www.mathworks.com/help/matlab/ref/trapz.html#buakefe-1_1) example.
function Q = trapezoidIntegral(x,f)
if isvector(f) % assume dimensions: x n-by-1, f 1-by-n
    Q = (x(2:end) - x(1:end-1)).' * (f(1:end-1) + f(2:end)).'/2;
else % assume dimensions: x n-by-1, f n-by-n
    Q = (x(2:end) - x(1:end-1)).' * (f(1:end-1,:) + f(2:end,:))/2;
end
end
